import React, {Component} from "react";
import Card from "../Card/Card";
import "./estilos.css";


class Baralho extends Component{

    constructor(props){
        super(props);
        
    }

         
    render(){
        
        return (
            
         <ul>
         
             {this.props.cartas.map((cartas,index)=>{
                 return(
                     <li id={cartas.id} >
                         <Card 
                          id={cartas.id} país={cartas.país} idh={cartas.idh} exp={cartas.exp}/>
                     </li>
                 )
             })}
             
         </ul>
            
        
       
        ); 
    }
}

export default Baralho;

